// O(nlogN)

package main

import (
	"fmt"
	"sort"
	"time"
)

func find(val float64, array []float64) (int, bool) {

	left := 0
	right := len(array) - 1
	for left <= right {
		mid := (right + left) / 2
		diff := val - array[mid]
		if diff > 0 && val - array[mid] < 1 && val < 0 || 
			val - array[mid] < 0 && val - array[mid] > -1 && val > 0 {
			return mid, true
		} else if val - array[mid] <= 0 && val < 0 || val > 0 && val - array[mid] > 0 {
			right = mid - 1
		} else {
			left = mid + 1
		}
	}
	return 0, false
}

func mirrorPairs(array []int) int {
	n := len(array)
	if n < 4 {
		return 0
	}

	// Хеш-таблицы для хранения разностей
	IDiffMap := make([]float64, 0, n)
	JDiffMap := make([]float64, 0, n)
	count := 0

	// Заполняем разности a[j+1] - a[j]
	for j := 2; j < n - 1; j++ {
		if diff := array[j + 1] - array[j]; diff >= 0 {
			JDiffMap = append(JDiffMap, float64(diff) + float64(j) / float64(n))
		} else {
			JDiffMap = append(JDiffMap, float64(diff) - float64(j) / float64(n))
		}
	}
	
	// Проверяем разности a[i] - a[i-1]
	for i := 1; i < n - 2; i++ {
		if diff := array[i] - array[i-1]; diff >= 0 {
			IDiffMap = append(IDiffMap, float64(diff) + float64(i) / float64(n))
		} else {
			IDiffMap = append(IDiffMap, float64(diff) - float64(i) / float64(n))
		}
	}
	sort.Float64s(JDiffMap)
	sort.Float64s(IDiffMap)
	
	//fmt.Println(IDiffMap)
	//fmt.Println(JDiffMap)
	
	
	for _, val := range IDiffMap {
		tmp := make([]float64, len(JDiffMap))
		copy(tmp, JDiffMap)
		for {
			if del, ok := find(val, tmp); ok {
				count++
				tmp = append(tmp[:del], tmp[del+1:]...)
			} else {
				break
			}
		}
	}
	return count
}

